export const AdOptions = Object.freeze({
  adChoicesPlacement: {
    topLeft: 0,
    topRight: 1,
    bottomLeft: 2,
    bottomRight: 3,
  },
  mediaAspectRatio: {
    unknown: 0,
    any: 1,
    landscape: 2,
    portrait: 3,
    square: 4,
  },
});
